import React from "react";
import { MDBSpinner } from 'mdbreact';

const SpinnerPage = () => {
  return (
    <>
      <MDBSpinner red />
      <MDBSpinner />
      <MDBSpinner yellow />
      <MDBSpinner green />
      <MDBSpinner multicolor />
    </>
  );
}

export default SpinnerPage;
